      out.write("\t// 计算金额\r\n");
      out.write("\tfunction calculate() {\r\n");
      out.write("\t\t// 合同金额\r\n");
      out.write("\t\tvar contractLoanAmount = Number($(\"#contractLoanAmount\").val());\r\n");
      out.write("\t\t// 贷款期限\r\n");
      out.write("\t\tvar loanPeriodType = Number($(\"#loanPeriodType\").combobox(\"getText\"));\r\n");
      out.write("\t\t// 月服务汇率\r\n");
      out.write("\t\tvar monthServiceFeeRate = Number(parseFloat($(\"#monthServiceFeeRate\")\r\n");
      out.write("\t\t\t\t.combobox(\"getText\")) / 100.0);\r\n");
      out.write("\t\t// 利息\r\n");
      out.write("\t\t/* var loanInterestRate = Number($(\"#loanInterestRate\")\r\n");
      out.write("\t\t\t\t.combobox(\"getText\")); */\r\n");
      out.write("\t\tvar loanInterestRate = Number($(\"#loanInterestRate\").numberbox(\r\n");
      out.write("\t\t\t\t'getValue'));\r\n");
      out.write("\t\t// 信访费用\r\n");
      out.write("\t\tvar visitFee = Number($(\"#visitFee\").val());\r\n");
      out.write("\t\t// 计算金额\r\n");
      out.write("\t\tif (contractLoanAmount != \"\" && loanPeriodType != \"\"\r\n");
      out.write("\t\t\t\t&& monthServiceFeeRate != \"\" && loanInterestRate != \"\"\r\n");
      out.write("\t\t\t\t&& visitFee != \"\") {\r\n");
      out.write("\t\t\t// 实放金额 = 合同金额-(合同金额*(服务汇率*贷款期限)+信访费用)\r\n");
      out.write("\t\t\tvar actualLoanAmount = contractLoanAmount\r\n");
      out.write("\t\t\t\t\t- (contractLoanAmount\r\n");
      out.write("\t\t\t\t\t\t\t* (monthServiceFeeRate * loanPeriodType) + visitFee);\r\n");
      out.write("\t\t\t// 月还款额 = (合同金额/贷款期限)+合同金额*利息\r\n");
      out.write("\t\t\tvar monthRepay = (contractLoanAmount / loanPeriodType)\r\n");
      out.write("\t\t\t\t\t+ contractLoanAmount * loanInterestRate;\r\n");
      out.write("\t\t\t$(\"#actualLoanAmount\").numberbox(\"setValue\", actualLoanAmount);\r\n");
      out.write("\t\t\t$(\"#monthRepay\").numberbox(\"setValue\", monthRepay);\r\n");
      out.write("\t\t}\r\n");
